import React from 'react'
import Typography from "@material-ui/core/Typography";

const Files = () => {
    return (
        <div>
            <Typography variant="h6">Files</Typography>
                  <FixedSizeList
                    height={300}
                    width={200}
                    itemSize={46}
                    itemCount={10}
                  >
                    {renderRow}
                  </FixedSizeList>
        </div>
    )
}
export default Files;
